import { DISPLAY } from "./constants";
let initialState = {
  number: 0,
  name: "New counter",
};

const changeName = (state = initialState, action) => {
  switch (action.type) {
    case DISPLAY:
      console.log("here action", action);
      console.log("here action.name", action.name);
      return { ...state, name: "New Counter" };
    default:
      return { ...state };
  }
};

export default changeName;
